import React, { useState, useEffect } from 'react';
import {
  Container,
  Grid,
  Button,
  Typography,
  Box,
  ButtonGroup,
  IconButton,
  Tooltip,
  Alert,
  Paper,
  Table,
  TableBody,
  TableCell,
  TableContainer,
  TableHead,
  TableRow,
  CircularProgress,
  Divider
} from '@mui/material';
import UndoIcon from '@mui/icons-material/Undo';

interface SequenceItem {
  symbol: number;
  created_at: string;
}

interface AnalysisData {
  markovChain?: {
    matrix: Record<string, Record<string, number>>;
    prediction: number | null;
    confidence: number;
    accuracy: number;
  };
  entropy?: {
    entropy: number;
    prediction: number | null;
    confidence: number;
    accuracy: number;
  };
  chiSquare?: {
    chiSquare: number;
    pValue: number;
    prediction: number | null;
    confidence: number;
    accuracy: number;
  };
  monteCarlo?: {
    simulations: number;
    prediction: number | null;
    confidence: number;
    accuracy: number;
  };
}

const GameAnalysisPage: React.FC = () => {
  const [sequence, setSequence] = useState<SequenceItem[]>([]);
  const [analysisData, setAnalysisData] = useState<AnalysisData>({});
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState<string | null>(null);
  const [generatingData, setGeneratingData] = useState(false);

  const symbols = ['♠', '♥', '♦', '♣'];

  const loadData = async () => {
    try {
      setLoading(true);
      setError(null);

      // Fetch sequence and analysis data
      const [seqResponse, analysisResponse] = await Promise.all([
        fetch('http://localhost:5000/api/sequences/1'),
        fetch('http://localhost:5000/api/analysis/1')
      ]);

      const seqData = await seqResponse.json();
      const analysisData = await analysisResponse.json();

      // Update states
      setSequence(Array.isArray(seqData?.symbols) ? seqData.symbols : []);
      if (analysisData.analyses) {
        setAnalysisData(analysisData.analyses);
      }
    } catch (error) {
      console.error('Error loading data:', error);
      setError('Failed to load data');
    } finally {
      setLoading(false);
    }
  };

  useEffect(() => {
    loadData();
  }, []);

  const addSymbol = async (symbolIndex: number) => {
    try {
      setError(null);
      await fetch('http://localhost:5000/api/sequences/1/symbol', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify({ symbol: symbolIndex }),
      });
      await loadData();
    } catch (error) {
      console.error('Error adding symbol:', error);
      setError('Failed to add symbol');
    }
  };

  const undoLastSymbol = async () => {
    try {
      setError(null);
      await fetch('http://localhost:5000/api/sequences/1/undo', {
        method: 'DELETE',
      });
      await loadData();
    } catch (error) {
      console.error('Error undoing last symbol:', error);
      setError('Failed to undo last symbol');
    }
  };

  const generateTestData = async () => {
    try {
      setGeneratingData(true);
      setError(null);

      await fetch('http://localhost:5000/api/sequences/generate-test-data', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify({ count: 90 })
      });

      await loadData();
    } catch (err) {
      console.error('Error generating test data:', err);
      setError('Failed to generate test data');
    } finally {
      setGeneratingData(false);
    }
  };

  const renderAnalysisTool = (name: string, data: any) => {
    if (!data) return null;

    return (
      <Grid item xs={6}>
        <Paper elevation={2} sx={{ p: 1.5, height: '100%' }}>
          <Typography variant="subtitle1" sx={{ fontWeight: 'bold', mb: 1 }}>
            {name}
          </Typography>
          <Box>
            <Typography variant="body2" sx={{ mb: 0.5 }}>
              Next: {data.prediction !== null ? (
                <span style={{ fontWeight: 'bold', fontSize: '1.1em' }}>
                  {symbols[data.prediction]}
                </span>
              ) : 'N/A'}
            </Typography>
            <Typography variant="body2" sx={{ fontSize: '0.9em', color: 'text.secondary' }}>
              Confidence: {(data.confidence * 100).toFixed(1)}%
            </Typography>
            <Typography variant="body2" sx={{ fontSize: '0.9em', color: 'text.secondary' }}>
              Accuracy: {(data.accuracy * 100).toFixed(1)}%
            </Typography>
          </Box>
        </Paper>
      </Grid>
    );
  };

  return (
    <Container maxWidth="lg">
      <Box sx={{ py: 4 }}>
        <Typography variant="h4" gutterBottom>
          RNG Analysis Tool
        </Typography>

        {error && (
          <Alert severity="error" sx={{ mb: 2 }}>
            {error}
          </Alert>
        )}

        <Grid container spacing={3}>
          {/* Game Controls */}
          <Grid item xs={12} md={6}>
            <Paper elevation={3} sx={{ p: 3 }}>
              <Typography variant="h5" gutterBottom>
                Game Controls
              </Typography>
              <Box sx={{ mb: 3 }}>
                <ButtonGroup 
                  variant="contained" 
                  size="large"
                  sx={{ 
                    mb: 2,
                    '& .MuiButton-root': {
                      fontSize: '1.5rem',
                      padding: '12px 24px',
                    }
                  }}
                >
                  {symbols.map((symbol, index) => (
                    <Button
                      key={symbol}
                      onClick={() => addSymbol(index)}
                      disabled={loading}
                    >
                      {symbol}
                    </Button>
                  ))}
                </ButtonGroup>
              </Box>
              <Box sx={{ display: 'flex', alignItems: 'center', mb: 3 }}>
                <Button
                  variant="contained"
                  onClick={generateTestData}
                  disabled={loading || generatingData}
                  sx={{ mr: 2 }}
                >
                  {generatingData ? 'Generating...' : 'Generate Test Data'}
                </Button>
                <IconButton 
                  onClick={undoLastSymbol}
                  disabled={loading || sequence.length === 0}
                  color="primary"
                  size="large"
                >
                  <UndoIcon fontSize="large" />
                </IconButton>
              </Box>
              <Typography variant="h6">
                Total Symbols: {sequence.length}
              </Typography>
            </Paper>
          </Grid>

          {/* Analysis Results */}
          <Grid item xs={12} md={6}>
            <Paper elevation={3} sx={{ p: 2 }}>
              <Typography variant="h6" gutterBottom>
                Analysis Results
              </Typography>
              {loading ? (
                <Box sx={{ display: 'flex', justifyContent: 'center', p: 2 }}>
                  <CircularProgress />
                </Box>
              ) : (
                <Grid container spacing={1}>
                  {Object.entries({
                    'Markov': analysisData.markovChain,
                    'Entropy': analysisData.entropy,
                    'Chi²': analysisData.chiSquare,
                    'Monte Carlo': analysisData.monteCarlo
                  }).map(([name, data]) => (
                    data && (
                      <Grid item xs={6} key={name}>
                        <Paper 
                          elevation={1} 
                          sx={{ 
                            p: 1, 
                            height: '100%',
                            backgroundColor: 'rgba(255,255,255,0.03)'
                          }}
                        >
                          <Typography variant="subtitle2" sx={{ fontWeight: 'bold' }}>
                            {name}
                          </Typography>
                          <Typography variant="body2" sx={{ mt: 0.5 }}>
                            Next: <strong>{data.prediction !== null ? symbols[data.prediction] : 'N/A'}</strong>
                          </Typography>
                          <Typography variant="caption" display="block" color="text.secondary">
                            Conf: {(data.confidence * 100).toFixed(0)}%
                          </Typography>
                          <Typography variant="caption" display="block" color="text.secondary">
                            Acc: {(data.accuracy * 100).toFixed(0)}%
                          </Typography>
                        </Paper>
                      </Grid>
                    )
                  ))}
                </Grid>
              )}
            </Paper>
          </Grid>
        </Grid>
      </Box>
    </Container>
  );
};

export default GameAnalysisPage;
